					game:GetService("ReplicatedStorage").Remotes.CommF_:InvokeServer("StartQuest", NaemQuest, LevelQuest)
				elseif game:GetService("Players").LocalPlayer.PlayerGui.Main.Quest.Visible == true then
					for i,v in pairs(game.Workspace.Enemies:GetChildren()) do
						if v.Name == Ms and v:FindFirstChild("Humanoid") and v:FindFirstChild("HumanoidRootPart") and v.Humanoid.Health > 0 then
								repeat wait()
									if string.find(game:GetService("Players").LocalPlayer.PlayerGui.Main.Quest.Container.QuestTitle.Title.Text, NameMon) then
										StartMagnet = true
									v.HumanoidRootPart.Size = Vector3.new(30, 30, 30)
									v.HumanoidRootPart.CanCollide = false
									v.Head.CanCollide = false
									v.Humanoid:ChangeState(11)
									sethiddenproperty(game.Players.LocalPlayer, "SimulationRadius", math.huge)
									game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame = CFrameMon
									game:GetService("VirtualUser"):CaptureController()
									game:GetService("VirtualUser"):Button1Down(Vector2.new(1280, 672))
								else
									StartMagnet = false
									CheckQuest()
									game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame = CFrameQuest
									wait(1.1)
									game:GetService("ReplicatedStorage").Remotes.CommF_:InvokeServer("StartQuest", NaemQuest, LevelQuest)
								end
								until not _G.AutoFarm or not v.Parent or game:GetService("Players").LocalPlayer.PlayerGui.Main.Quest.Visible == false
