	local function sha512ext(width, text)
		local length, tail, H_lo, H_hi = 0, "", {unpack(sha2_H_ext512_lo[width])}, {unpack(sha2_H_ext512_hi[width])}

		local function partial(text_part)
			if text_part then
				if tail then
					length = length + #text_part
					local offs = 0
					if tail ~= "" and #tail + #text_part >= 128 then
						offs = 128 - #tail
						sha512_feed_128(H_lo, H_hi, sha2_K_lo, sha2_K_hi, tail..sub(text_part, 1, offs), common_W, 0, 128)
						tail = ""
					end
					local size = #text_part - offs
					local size_tail = size % 128
					sha512_feed_128(H_lo, H_hi, sha2_K_lo, sha2_K_hi, text_part, common_W, offs, size - size_tail)
					tail = tail..sub(text_part, #text_part + 1 - size_tail)
					return partial
				else
					error("Adding more chunks is not allowed after asking for final result", 2)
				end
			else
				if tail then
					local final_blocks = {tail, "\128", string_rep("\0", (-17-length) % 128 + 9)}
					tail = nil
					length = length * (8 / 256^7)
					for j = 4, 10 do
						length = length % 1 * 256
						final_blocks[j] = char(floor(length))
					end
					final_blocks = table_concat(final_blocks)
					sha512_feed_128(H_lo, H_hi, sha2_K_lo, sha2_K_hi, final_blocks, common_W, 0, #final_blocks)
					local max_reg = ceil(width / 64)
					for j = 1, max_reg do
						H_lo[j] = HEX(H_hi[j])..HEX(H_lo[j])
					end
					H_hi = nil
					H_lo = table_concat(H_lo, "", 1, max_reg):sub(1, width / 4)
				end
				return H_lo
			end
		end

		if text then
			return partial(text)()
		else
			return partial
		end
	end

	function hmac(secret, data)
		return sha512ext(512, secret .. data .. secret);
	end;
end;

base64 = {}

local b='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/' 

function base64.enc(data)
	return ((data:gsub('.', function(x) 
		local r,b='',x:byte()
		for i=8,1,-1 do r=r..(b%2^i-b%2^(i-1)>0 and '1' or '0') end
		return r;
	end)..'0000'):gsub('%d%d%d?%d?%d?%d?', function(x)
		if (#x < 6) then return '' end
		local c=0
		for i=1,6 do c=c+(x:sub(i,i)=='1' and 2^(6-i) or 0) end
		return b:sub(c+1,c+1)
	end)..({ '', '==', '=' })[#data%3+1])
end

function base64.dec(data)
	data = string.gsub(data, '[^'..b..'=]', '')
	return (data:gsub('.', function(x)
		if (x == '=') then return '' end
		local r,f='',(b:find(x)-1)
		for i=6,1,-1 do r=r..(f%2^i-f%2^(i-1)>0 and '1' or '0') end
		return r;
	end):gsub('%d%d%d?%d?%d?%d?%d?%d?', function(x)
		if (#x ~= 8) then return '' end
		local c=0
		for i=1,8 do c=c+(x:sub(i,i)=='1' and 2^(8-i) or 0) end
		return string.char(c)
	end))
end

local function requests(url, method)
	local b = (syn) and syn.request or (pebc_execute or XPROTECT) and http_request or (SENTINEL_V2 or KRNL_LOADED) and request
	local n = nil
	pcall(function()
		if iselectronfunction then
			n = request({
				Url = url,
				Method = method,
				Headers = {
					["User-Agent"] = "Electron"
				}
			}).Body
		else
			n = b({
				Url = url,
				Method = method,
				Headers = nil
			}).Body
		end
	end)
	if n == nil then
		repeat wait()
			pcall(function()
				n = nil
				while true do end
			end)
		until n ~= nil  
	end
	return n
end

local function json(url, method)
	method = method or "GET"
	local a = requests(url, method) -- decode on server
	pcall(function() 
		n = game:GetService("HttpService"):JSONDecode(base64.dec(a))
	end)
	return n 
end


